import React from "react";

import "./Toolbar.css";
import Logo from "../../../assets/logo_2_vari.png";
import NavigationItems from "../NavigationItems/NavigationItems";

const toolbar = props => (
  <header className="Toolbar">
    <div className="Logo">
      <Logo />
    </div>
    <nav className="DesktopOnly">
      <NavigationItems />
    </nav>
  </header>
);

export default toolbar;
